import  React, { useEffect,useState } from 'react'
import axios from 'axios'
import serverApiHost from "../../global";


import View from '../Card/View'

const PageAllCards = () =>
{

    const [dataCards, setDataCards] = useState<Object>()

    const GetInformationAboutCard = async () => {

        const response = await axios.get('http://'+serverApiHost+':5001/api/cardVSM/view')

        if(response.status != 200)
        {
          return ;
        }

        let content = response.data as any;

        setDataCards(content);

        console.log("LOADING = ",dataCards)
    }


    useEffect(() => {
         GetInformationAboutCard();
    },[])


    if(dataCards === null)
    {
        return <div>

        </div>;
    }   

    return (
        <div>
            <p>PageAllCards</p>
            <p>{dataCards.message}</p>

            {dataCards.cards.forEach( (item: any) => {
                return  <View key={item.order.id} item={item}/>
            })}
        </div>
    )   
}


export default PageAllCards;
